As TUSCON revealed himself so did the other figures. The most
prominant was the one to the front of TUSCON, he looked like he turned
into a creature similar to SLAG&#39;s beastmode that of an organic
triceratops dinosaur. However he was constructed differently and he
was was a mustard yellow in color.

However he was in robot mode now, and although he resembled slag, he
was not as massive as he, standing a little shorter than TUSCON
himself, but he also looked far more intelligent.

To either side there were two other figures, one was purple and red
and looked like he turned into some sort of avian creature similar to
TERRORSAUR and the other was a marine green with purple chestplating.
He looked like he might turn into something similar to DINOBOT, but it
was difficult to tell. Both of them were a little smaller than the
figure that stood in front of TUSCON

The first figure standing before TUSCON spoke, obviously the one in
charge as held his weapon on TUSCON and shook his head. &quot;No.&quot; he said.
&quot;You will come with us now. The only choice you have is how it will be
done. You can either be our prisoner or as a burnt out chassis!&quot;

The two on the sides of TUSCON just chuckled evilly as they held their
weapons on him.

